import requests
from bs4 import BeautifulSoup
import pandas as pd

"""# #2 Scraping Link Berita"""

# Link Kategori
category_links = [
    {'name': 'gadget', 'link': 'https://tekno.kompas.com/gadget'},
    {'name': 'internet', 'link': 'https://tekno.kompas.com/internet'}
]

# Variabel untuk menampung semua links dari semua kategori
news_links = []

# Fungsi untuk mengambil link dari setiap kategori pada dua halaman pertama
def getLinks(category_link, num_pages = 1):
    base_url = category_link['link']
    for n in range(1, num_pages+1):  # Loop untuk dua halaman pertama
        url = f"{base_url}/{n}"
        req = requests.get(url)
        req_beauty = BeautifulSoup(req.content, 'html.parser')

        # Cari div dengan kelas 'latest--news'
        populer = req_beauty.find('div', class_='latest--news')

        # Cek apakah div 'latest--news' ditemukan
        if populer:
            # Cari semua tag 'a' dengan kelas 'article__link'
            list_berita = populer.find_all('a', class_='article__link')

            for beritanya in list_berita:
                data = {}
                data['judul'] = beritanya.text.strip()  # Menghilangkan spasi di awal dan akhir
                data['link'] = beritanya.get('href')
                data['category'] = category_link['name']
                news_links.append(data)
        else:
            print(f"Div 'latest--news' tidak ditemukan di {url}")

"""Fungsi `getLinks()` di atas akan melakukan scraping pada tiap link yang ada pada variabel category_links.

Parameter:
1. `category_link` untuk menerima objek link berita. Dalam hal ini adalah variabel category_links

2. `num_pages` untuk menentukan berapa halaman/pagination yang akan discraping. Defaultnya adalah satu halaman pagination.
"""

# Memulai untuk mescraping berita
for category_link in category_links:
  getLinks(category_link, 2)

# Membuat Data Frame
df = pd.DataFrame(news_links)
len(df)

"""# #3 Scraping Konten Berita"""

def getContent(link):
    req = requests.get(link)
    req_beauty = BeautifulSoup(req.content, 'html.parser')
    content = req_beauty.find('div', class_='read__content')

    if content:
        text_content = content.get_text(separator=' ', strip=True)
        print(f"Done get content from {link}")
        return text_content
    else:
        print(f"Div 'read__content' tidak ditemukan di {link}")
        return None

# Iterasi untuk memanggil getContent() dan memasukkan konten ke dalam atribut content
for link in df.link:
  df.loc[df['link'] == link, 'content'] = getContent(link)

df.head()

# Mendownload Data
df.to_csv('Data Berita Kompas.csv', index=False)